    /// description: 展示错误页失败
    case failedToShowTheErrorPage = 2
    /// description: 错误页未展示，不可隐藏
    case cannotBeHidden = 3
    /// description: 隐藏错误页失败
    case failedToHideTheErrorPage = 4

